"use strict";
const App = function (p_params) {
    let params = {
        name: null,
        age: 0
    };


    params = s_utils.params(params, p_params)



    const _registerEvents = () => {
        document.getElementById("btnHome").addEventListener('click', function (event) {

            s_rt.view("home");

        }, false);
        document.getElementById("btnAbout").addEventListener('click', function (event) {

            s_rt.view("about");

        }, false);

        document.getElementById("btnTerms").addEventListener('click', function (event) {

            s_rt.view("terms");

        }, false);

        document.getElementById("btnOverlay").addEventListener('click', function (event) {

            alert("Hey Jude!");

        }, false);


    }

    /* Public Methods */
    return {
        init: function () {
            //manageState();
            s_rt._initLandingPage("home");
            _registerEvents();

            s_rt._preloadViews();
            s_rt._preloadImages();


            // _lazyload();
        },
        unload: function () {
            unregisterEvents();
        }
    };
}
/* End Public Methods */
const app = new App();
app.init();